// src/pages/Profile/Profile.js
import React, { useEffect, useState } from "react";
import axiosInstance from "../../utils/axiosInstance";
import { Link } from "react-router-dom";

const API = process.env.REACT_APP_API_URL || "http://localhost:5000";

export default function Profile() {
  const [profile, setProfile] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axiosInstance
      .get("/profile")   // ✅ FIXED
      .then((res) => {
        setProfile(res.data);
        setLoading(false);
      })
      .catch((err) => {
        console.error("PROFILE ERROR:", err);
        setLoading(false);
      });
  }, []);

  if (loading) return <p className="text-center mt-10">Loading...</p>;
  if (!profile)
    return (
      <p className="text-center mt-10 text-red-500">
        Unable to load profile.
      </p>
    );

  return (
    <div className="max-w-3xl mx-auto mt-10 bg-white p-6 rounded shadow">
      <h1 className="text-3xl font-bold mb-5">My Profile</h1>

      {/* Profile Picture */}
      <img
        src={
          profile.profilePic
            ? `${API}/uploads/${profile.profilePic}`
            : "https://via.placeholder.com/120"
        }
        className="h-28 w-28 rounded-full mb-4 object-cover border"
        alt="Profile"
      />

      <p><strong>Name:</strong> {profile.name}</p>
      <p><strong>Email:</strong> {profile.email}</p>
      <p><strong>Role:</strong> {profile.role}</p>
      <p><strong>Bio:</strong> {profile.bio || "—"}</p>

      {profile.role === "candidate" && (
        <div className="mt-5">
          <p><strong>Phone:</strong> {profile.phone || "—"}</p>
          <p><strong>Experience:</strong> {profile.experience || "—"}</p>
          <p>
            <strong>Skills:</strong> 
            {(profile.skills || []).join(", ") || "—"}
          </p>

          {profile.resume && (
            <a
              href={`${API}/uploads/${profile.resume}`}
              className="text-blue-600 underline block mt-2"
              target="_blank"
              rel="noreferrer"
            >
              Download Resume
            </a>
          )}
        </div>
      )}

      {profile.role === "employer" && (
        <div className="mt-5">
          <p><strong>Company:</strong> {profile.companyName || "—"}</p>
          <p><strong>Website:</strong> {profile.companyWebsite || "—"}</p>
          <p><strong>Description:</strong> {profile.companyDescription || "—"}</p>

          {profile.companyLogo && (
            <img
              src={`${API}/uploads/${profile.companyLogo}`}
              className="h-20 mt-2 rounded border"
              alt="Logo"
            />
          )}
        </div>
      )}

      <div className="mt-6">
        <Link to="/profile/edit"
          className="inline-block bg-blue-600 text-white px-4 py-2 rounded">
          Edit Profile
        </Link>

        <Link to="/profile/password"
          className="inline-block bg-gray-700 text-white px-4 py-2 rounded ml-3">
          Change Password
        </Link>
      </div>
    </div>
  );
}
